class WeatherData extends React.Component {
  componentDidMount() {
    if (this.props.getWeather) this.props.getWeather();
  }

  render() {
    if (!this.props.weather) {
        return <div>Загрузка...</div>
    }

    return (
      <div>
      <div>{this.props.weather.response.name}</div>
      
      </div>
    );
  }
}

export default WeatherData
